import React from 'react';
import { Link } from 'react-router-dom';
import '../Css/Navbar.css';

export const Navbar = () => {
    return (
        <header>
            <ul className="navbar">
                {/* <div className="link"><Link to="/">LOGO</Link></div>
                <div className="link"><Link to="/">Search</Link></div>
                <div className="link"><Link to="/mylist">myList</Link></div>
                <div className="link"><Link to="/watched">watched</Link></div> */}
                <Link className="link" to="/">Logo</Link>
                <Link className="link" to="/">Search</Link>
                <Link className="link" to="mylist">MyList</Link>
            </ul>
        </header>
    )
}
